package pattern;

public class first {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
//		* * * * *
//		* * * * *
//		* * * * *
//		* * * * *
//		* * * * *
		int n=5;
		int i=0;
		while(i!=n) {
			int j=0;
			while(j!=n) {
				System.out.print("* ");	
				j++;
			}
			System.out.println();
			
			i++;
		}

	}

}
